import React from "react";
import { Box, Flex, HStack, IconButton, useDisclosure } from "@chakra-ui/react";
import { HamburgerIcon, CloseIcon } from "@chakra-ui/icons";

const Navbar = () => {
  const { isOpen, onOpen, onClose } = useDisclosure();

  return (
    <Box className="bg-blue-500 fixed top-0 w-full z-10 shadow-lg">
      <Flex
        h="16"
        alignItems="center"
        justifyContent="space-between"
        className="px-4"
      >
        <Box className="text-white font-bold text-lg">MyLogo</Box>
        <HStack
          as="nav"
          spacing="4"
          className="hidden md:flex"
          display={{ base: "none", md: "flex" }}
        >
          <Box className="text-white cursor-pointer">Home</Box>
          <Box className="text-white cursor-pointer">About</Box>
          <Box className="text-white cursor-pointer">Contact</Box>
        </HStack>

        <IconButton
          size="md"
          icon={isOpen ? <CloseIcon /> : <HamburgerIcon />}
          aria-label="Open Menu"
          display={{ base: "flex", md: "none" }}
          onClick={isOpen ? onClose : onOpen}
          className="text-white"
        />
      </Flex>

      {isOpen ? (
        <Box className="md:hidden px-4 pb-4">
          <Box className="text-white py-2">Home</Box>
          <Box className="text-white py-2">About</Box>
          <Box className="text-white py-2">Contact</Box>
        </Box>
      ) : null}
    </Box>
  );
};

export default Navbar;
